    y[30] = x[30]*14.006700*XWinv; 
    y[31] = x[31]*15.014670*XWinv; 
    y[32] = x[32]*16.022640*XWinv; 
    y[33] = x[33]*17.030610*XWinv; 
    y[34] = x[34]*29.021370*XWinv; 
    y[35] = x[35]*30.006100*XWinv; 
    y[36] = x[36]*46.005500*XWinv; 
    y[37] = x[37]*44.012800*XWinv; 
